import React from 'react';
//import Calendly from './components/Calendar';
// import Navbar from './components/Navbar';
import { useAuth0 } from "@auth0/auth0-react";
import { BrowserRouter as Router, Switch, Route, useRouteMatch } from 'react-router-dom';
import Header from './components/Header';
import FileUploadPage from './components/uploadFile';
import StartButton from './components/StartButton';
import SelectionButton from './components/SelectionButton';
import Spinner from './components/Spinner';

function App() {

  const { isLoading, isAuthenticated } = useAuth0();
  const match = useRouteMatch('/');

  if (isLoading) { return (<Spinner/>) };
  if (!isAuthenticated) { return (<StartButton/>) };

  return ( 
    <Router>
      <div className="header">
        {match ? <Header isFeature='exists'/> : <Header/>}
      </div>
      <Switch>
        <Route path="/FileUpload">
          <FileUploadPage/>
        </Route>
        <Route path="/">
          <SelectionButton name='Matching' path="#"/>
          <SelectionButton name='Scheduling' path="/FileUpload"/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
